var request = JSON.parse(requestjson);

var originalApps = request.applicants;
var appCount = originalApps.length;

//Prep for the variable that will be used in the execution context
var ArrayList = Java.type("java.util.ArrayList");
var appList = new ArrayList();

//Generate an updated list of applicants containing only applicants/employments that are not complete.
for (var i = 0; i < appCount; i++ ){
    var newEmps = [];
    var thisApp = originalApps[i];
    //Get all the employments. We need to see if all are completed.
    for (var j = 0; j < thisApp.employments.length; j++){
        var thisEmp = thisApp.employments[j];
        if (containsReverification == 'true') {
            if (thisEmp.verificationMethod !== 'TWN' && thisEmp.originalEmploymentId != null && thisEmp.voeState === 'SUBMITTED'){
                thisEmp.requestId = request.productRequestRefId
                thisEmp.loanNumber = request.loanNumber
                newEmps.push(thisEmp);
            }
        } else {
            if (thisEmp.voeState !== 'COMPLETED' && thisEmp.voeState !== 'CANCELLED') {
                thisEmp.requestId = request.productRequestRefId
                thisEmp.loanNumber = request.loanNumber
                newEmps.push(thisEmp);
            }
        }
    }
    //Only add the applicant if there are incomplete employments for them
    if (newEmps !== null && newEmps.length > 0) {
            thisApp.employments = newEmps;
            thisApp.requestId = request.productRequestRefId
            thisApp.loanNumber = request.loanNumber
            appList.add(JSON.stringify(thisApp));
    }
}

execution.setVariable("applicants", appList);

print("APPLICANTS.....");
print(appList);

execution.setVariable("authenticatedUserId","1");
execution.setVariable("tenantId","tenant_1");
execution.setVariable("dateCreated", request.dateCreated);
execution.setVariable("customerName", request.customerName || "");
execution.setVariable("losClientName", request.losClientName || "");
execution.setVariable("requester", request.requester.firstName + '  ' + request.requester.lastName);
execution.setVariable("requesterEmail", request.requester.email);

